  return (
    <div
      style={{
        width: "25%",
        padding: "10px",
        boxSizing: "border-box",
      }}
    >

      <strong>{product.name}</strong> ({product.description})
      <img
        src={product.imageUrl}
        alt={product.description}
        style={{
          display: "block",
          maxWidth: "100%",
          display: "inline-block",
          width:"33.33%",
          verticalAlign:"middle",
          boxSizing:"border-box",
          margin:'0px',
          padding:'0px'

        }}
      />
    </div>
  );
}
